    function InversePairs(data) {
      // write code here
      let len = data.length;
      if (len < 2) return 0;
      let tmp = new Array(len);

      const divide = (left, right) => {
        if (left === right) return 0
        let mid = left + Math.floor((right - left) / 2)
        let leftCount = divide(left, mid);
        let rightCount = divide(mid + 1, right);
        let crossCount = merge(left, mid, right);
        return leftCount + rightCount + crossCount;

      }

      const merge = (left, mid, right) => {
        //拷贝数组
        for (let i = left; i <= right; i++) {
          tmp[i] = data[i];
        }
        let count = 0;
        let i = left;
        let j = mid + 1;
        for (let k = left; k <= right; k++) {
          if (i === mid + 1) {
            data[k] = tmp[j];
            j++;
          } else if (j === right + 1) {
            data[k] = tmp[i];
            i++;
          } else if (tmp[i] <= tmp[j]) {
            data[k] = tmp[i];
            i++;
          } else {
            data[k] = tmp[j];
            j++;
            count = count + (mid - i + 1);
          }
        }
        return count;
      }

      return divide(0, len - 1);

    }
